package com.consultec.esigns.listener;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.OutputStream;
import java.io.Serializable;
import java.net.HttpURLConnection;
import java.net.URL;

import org.apache.http.HttpEntity;
import org.apache.http.client.ClientProtocolException;
import org.apache.http.client.methods.CloseableHttpResponse;
import org.apache.http.client.methods.HttpPost;
import org.apache.http.entity.ContentType;
import org.apache.http.entity.StringEntity;
import org.apache.http.impl.client.CloseableHttpClient;
import org.apache.http.impl.client.HttpClients;

import com.fasterxml.jackson.databind.ObjectMapper;

public class RESTClient {

	final static String HOST = "http://virtserver.swaggerhub.com";
//	final static String HOST = "http://10.252.103.173:7812";
	final static String RESOURCE = "/Student33/bit4id/1.0.0/bgeneral/firmas/firmaelectronica";  
	final static String URL = HOST + RESOURCE;
	final static String METHOD = "POST";
	final static String CONTENT_TYPE_KEY = "Content-Type";
	final static String CONTENT_TYPE_JSON = "application/json";

	class WrapperDocument implements Serializable {
		/**
		 * 
		 */
		private static final long serialVersionUID = -5096666753977571678L;
		Integer validation;
		String level;
		String format;
		String document;

		public WrapperDocument() {
		}

		public Integer getValidation() {
			return validation;
		}

		public void setValidation(Integer validation) {
			this.validation = validation;
		}

		public String getLevel() {
			return level;
		}

		public void setLevel(String level) {
			this.level = level;
		}

		public String getFormat() {
			return format;
		}

		public void setFormat(String format) {
			this.format = format;
		}

		public String getDocument() {
			return document;
		}

		public void setDocument(String document) {
			this.document = document;
		}
		
	}

	public static void main(String[] args) throws IOException {
		RESTClient d = new RESTClient();
		WrapperDocument document = d.new WrapperDocument();
		document.validation = 0;
		document.level = "T";
		document.format = "pades";
		document.document = "";
		
		try {
			usingApacheLibrary(document);
			usingURLConnection(document);
		}catch (Exception e) {
			System.err.println(e.getMessage());
		}
	}

	private static void usingURLConnection(WrapperDocument instance) throws IOException {
		URL url = new URL(URL);
		HttpURLConnection conn = (HttpURLConnection) url.openConnection();
		conn.setDoOutput(true);
		conn.setRequestMethod(METHOD);
		conn.setRequestProperty(CONTENT_TYPE_KEY, CONTENT_TYPE_JSON);
		ObjectMapper objectMapper = new ObjectMapper();
		String pckg = objectMapper.writeValueAsString(instance);
		OutputStream os = conn.getOutputStream();
		os.write(pckg.getBytes());
		os.flush();

		if (conn.getResponseCode() != HttpURLConnection.HTTP_CREATED) {
			throw new RuntimeException("Failed : HTTP error code : " + conn.getResponseCode());
		}

		BufferedReader br = new BufferedReader(new InputStreamReader((conn.getInputStream())));

		String output;
		System.out.println("Output from Server .... \n");
		while ((output = br.readLine()) != null) {
			System.out.println(output);
		}
		conn.disconnect();
	}

	@SuppressWarnings("unused")
	private static void usingApacheLibrary(WrapperDocument instance) throws ClientProtocolException, IOException {
		CloseableHttpClient httpclient = HttpClients.createDefault();
		HttpPost httpPost = new HttpPost(URL);
		ObjectMapper objectMapper = new ObjectMapper();
		String pckg = objectMapper.writeValueAsString(instance);
		HttpEntity stringEntity = new StringEntity(pckg, ContentType.APPLICATION_JSON);
		httpPost.setEntity(stringEntity);
		CloseableHttpResponse response2 = httpclient.execute(httpPost);
	}
}
